<span id="line515"></span></span><span>&lt;<span class="start-tag">strong</span>&gt;</span><span>1. </span><span>&lt;<span class="start-tag">a</span> <span class="attribute-name">class</span>="<a class="attribute-value">key_underline</a>" <span class="attribute-name">href</span>="<a class="attribute-value" href="view-source:https://timesofindia.indiatimes.com/topic/Cancer">https://timesofindia.indiatimes.com/topic/Cancer</a>"&gt;</span><span>Cancer</span><span>&lt;/<span class="end-tag">a</span>&gt;</span><span> prevention:</span><span>&lt;/<span class="end-tag">strong</span>&gt;</span><span> Broccoli shares cancer fighting and immune boosting properties with other cruciferous vegetables such as cauliflower, Brussels sprouts and cabbage. Broccoli contains properties that depletes estrogens which usually cause cancer in the body. Research shows that broccoli is extremely suitable for preventing breast and uterus cancer.
<span id="line516"></span></span><span>&lt;<span class="start-tag">br</span>&gt;</span><span>
<span id="line517"></span></span><span>&lt;<span class="start-tag">strong</span>&gt;</span><span></span><span>&lt;<span class="start-tag">br</span>&gt;</span><span>2. </span><span>&lt;<span class="start-tag">a</span> <span class="attribute-name">class</span>="<a class="attribute-value">key_underline</a>" <span class="attribute-name">href</span>="<a class="attribute-value" href="view-source:https://timesofindia.indiatimes.com/topic/Cholesterol">https://timesofindia.indiatimes.com/topic/Cholesterol</a>"&gt;</span><span>Cholesterol</span><span>&lt;/<span class="end-tag">a</span>&gt;</span><span> reduction:</span><span>&lt;/<span class="end-tag">strong</span>&gt;</span><span> Like many whole foods, broccoli is packed with soluble fiber that draws cholesterol out of your body. This is because the fiber in broccoli helps bind with bile acids in the digestive tract. This makes excreting cholesterol out of our body easy. According to a research by the Institute of Food Research, a particular variety of broccoli can help reduce the blood LDL-cholesterol levels by 6 per cent.
<span id="line518"></span></span><span>&lt;<span class="start-tag">br</span>&gt;</span><span>
<span id="line519"></span></span><span>&lt;<span class="start-tag">br</span>&gt;</span><span>
<span id="line520"></span></span><span>&lt;<span class="start-tag">strong</span>&gt;</span><span>3. Reducing allergic reaction and inflammation:</span><span>&lt;/<span class="end-tag">strong</span>&gt;</span><span> Research has shown the ability of kaempferol to lessen the impact of allergy-related substances on our body. Broccoli even has significant amounts of omega 3 fatty acids, which are well known as anti-inflammatory. Along with this, broccoli can also help people suffering from arthritis as broccoli contains sulforaphane, a chemical that blocks the enzymes that can cause joint destruction and hence lead to inflammation.
<span id="line521"></span></span><span>&lt;<span class="start-tag">br</span>&gt;</span><span>
<span id="line522"></span></span><span>&lt;<span class="start-tag">br</span>&gt;</span><span>
<span id="line523"></span></span><span>&lt;<span class="start-tag">strong</span>&gt;</span><span>4. Powerful antioxidant:</span><span>&lt;/<span class="end-tag">strong</span>&gt;</span><span> Broccoli contains antioxidants that can help the body in a variety of ways. Broccoli is deeply concentrated with vitamin C, making it great for immunity. Other than this, broccoli also contains flavonoids which help recycle the vitamin C efficiently. It is also enriched with carotenoids lutein, zeaxanthin, beta-carotene and other power packed antioxidants.
<span id="line524"></span></span><span>&lt;<span class="start-tag">br</span>&gt;</span><span>
<span id="line525"></span></span><span>&lt;<span class="start-tag">br</span>&gt;</span><span>
