<span id="line527"></span></span><span>&lt;<span class="start-tag">br</span>&gt;</span><span>
<span id="line528"></span></span><span>&lt;<span class="start-tag">strong</span>&gt;</span><span>5. Bone health:</span><span>&lt;/<span class="end-tag">strong</span>&gt;</span><span> Broccoli contains high levels of both calcium and vitamin K, both of which are important for bone health and prevention of osteoporosis. Along with calcium, broccoli is also full of other nutrients like magnesium, zinc and phosphorous. Because of these properties, broccoli is extremely suitable for children, elderly and lactating mothers.
<span id="line529"></span></span><span>&lt;<span class="start-tag">br</span>&gt;</span><span>
<span id="line530"></span></span><span>&lt;<span class="start-tag">br</span>&gt;</span><span>
<span id="line531"></span></span><span>&lt;<span class="start-tag">strong</span>&gt;</span><span>6. Heart health: </span><span>&lt;/<span class="end-tag">strong</span>&gt;</span><span>The anti-inflammatory properties of sulforaphane, one of the isothiocyanates (ITCs) in broccoli, may be able to prevent (or even reverse) some of the damage to blood vessel linings that can be caused by inflammation due to chronic blood sugar problems. Broccoli is great for heart health as it contains fibers, fatty acids and vitamins that help regulating blood pressure in the body. This also helps in reducing bad cholesterol, hence leading to a healthy heart. Broccoli helps protecting blood vessels from damaging as well.
<span id="line532"></span></span><span>&lt;<span class="start-tag">br</span>&gt;</span><span>
<span id="line533"></span></span><span>&lt;<span class="start-tag">br</span>&gt;</span><span>
<span id="line534"></span></span><span>&lt;<span class="start-tag">strong</span>&gt;</span><span>7. Diet aid:</span><span>&lt;/<span class="end-tag">strong</span>&gt;</span><span> Broccoli is a good carb and is high in fiber, which aids in digestion, prevents constipation, maintains low blood sugar, and curbs overeating. Along with this, broccoli is also great for weight loss because it is rich in fiber. It is an ideal green vegetable to include in your salads and completing your five coloured vegetables everyday. In addition to this, broccoli also contains proteins, making it suitable for vegetarians that are otherwise not able to complete their protein requirement.
