<span id="line545"></span></span><span>&lt;<span class="start-tag">strong</span>&gt;</span><span>10. Eye care: </span><span>&lt;/<span class="end-tag">strong</span>&gt;</span><span>Broccoli contains beta-carotene, vitamin A, phosphorous and other vitamins such B complex, vitamin C and E. All these rich nutrients are great for eye health as these help in protecting the eyes against mascular degeneration, cataract and even repairs damage done by harmful radiations we go through by being constantly on our phones or being in front of a screen.
