<span id="line548"></span></span><span>&lt;<span class="start-tag">strong</span>&gt;</span><span>11. Anti-ageing:</span><span>&lt;/<span class="end-tag">strong</span>&gt;</span><span> Since broccoli is enriched with vitamin C, which has numerous antioxidant properties, it is great for anti-ageing. This is because antioxidants help fight the free radicals responsible for ageing. These free radicals often damage the skin. Eating broccoli regularly helps in reducing fine lines, wrinkles, skin issues like acne and even pigmentation.
